import React from 'react'
import { API, PostType } from '@API/index'
import styled from 'styled-components'
import { ListPosts } from '@Features/Posts'

const ContentWrapped = styled.div``
interface PropsType {
	posts: PostType[]
}
const HomePage: React.FC<PropsType> = ({ posts }): React.ReactElement => {
	return (
		<ContentWrapped>
			<ListPosts posts={posts} />
		</ContentWrapped>
	)
}

export const getStaticProps = async (propss): Promise<{ props: { posts: PostType } }> => {
	const response = await API.PostsAPI.getPosts()
	const posts = response.data

	return {
		props: {
			posts,
		},
	}
}
export default HomePage
